import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { CreardisciplinaComponent } from './components/creardisciplina/creardisciplina.component';
import { MostrardisciplinaComponent } from './components/mostrardisciplina/mostrardisciplina.component';
import { CrearCompetidorComponent } from './components/crear-competidor/crear-competidor.component';
import { CrearStakeComponent } from './components/crear-stake/crear-stake.component';
import { CrearEventComponent } from './components/crear-event/crear-event.component';
import { MostrarCompetidorComponent } from './components/mostrar-competidor/mostrar-competidor.component';
import { MostrarStakeComponent } from './components/mostrar-stake/mostrar-stake.component';
import { MostrarEventComponent } from './components/mostrar-event/mostrar-event.component';

const routes: Routes = [
  { path: 'saveDiscipline', component: CreardisciplinaComponent },
  { path: 'updateDiscipline/:id', component: CreardisciplinaComponent },
  { path: 'mostrarDiscipline', component: MostrardisciplinaComponent},

  { path: 'saveCompetitor', component:CrearCompetidorComponent },
  { path: 'updateCompetitor/:id', component: CrearCompetidorComponent },
  { path: 'mostrarCompetitor', component:MostrarCompetidorComponent},

  { path: 'saveEvent', component: CrearEventComponent},
  { path: 'updateEvent/:id', component: CrearEventComponent },
  { path: 'mostrarEvent', component:MostrarEventComponent},

  { path: 'saveStake', component: CrearStakeComponent},
  { path: 'updateStake:id', component: CrearStakeComponent },
  { path: 'mostrarStake', component: MostrarStakeComponent},

  { path: '**', redirectTo: '', pathMatch: 'full' }
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
